import React from "react";
import { Link } from "react-router-dom";

export default () => {
  return (
    <div>
      <ul>
        <li className="change">
          <Link to="/">Home</Link>
        </li>
        <li>
          <Link to="/books">Books</Link>
        </li>
        <li>
          <Link to="/authors">Authors</Link>
        </li>
      </ul>
    </div>
  );
};
